import React, {useEffect, useState} from 'react';
import {Avatar, AppBar, Button, Card, CardContent, Icon, IconButton, List, ListItem, ListItemSecondaryAction, ListItemText, Toolbar, Typography} from '@material-ui/core';
import {FuseAnimateGroup} from '@fuse';
import SemCard from '../usables/SemCard'
import { useDispatch, useSelector } from 'react-redux';
import withReducer from 'app/store/withReducer';
import reducer from 'app/main/academy/store/reducers';
import * as Actions from 'app/main/academy/store/actions';




function StudentProfileTab(props)
{
    const dispatch = useDispatch();
    const pastRecord = useSelector(({academyApp}) => academyApp.crp);
    const user=useSelector(({auth}) => auth.user);
    function separateBySession(record)
    {
        var data = record.data
        var output ={};
        var i = 0;
        console.log("data", data.length)
        for(i =0 ; i < data.length ; i++)
        {
            console.log('hello')
            if (output[data[i].sem + data[i].session] == undefined)
            {
                output[data[i].sem + data[i].session] = [data[i]];

            }
            else {
                // console.log(output[data[i].sem]);
                output[ data[i].sem+ data[i].session].push(data[i]);
            }

        }


        return output;
    }
    var result = {};
    if (pastRecord != undefined)
    {
      result =   separateBySession(pastRecord);
    }

    useEffect(() => {
        dispatch(Actions.getStudentRecord());

    },[dispatch, props]);

    return (

        <div className="md:flex max-w-2xl">
            <div className="flex flex-col flex-1 md:pr-32">
                <FuseAnimateGroup
                    enter={{
                        animation: "transition.slideUpBigIn"
                    }}
                >
                { Object.keys(result).map((value) => (
                    <SemCard  item = {result[value]}/>
                 )) }

                </FuseAnimateGroup>
            </div>
        </div>
    );
}

export default withReducer('academyApp', reducer)(StudentProfileTab);
